import React from 'react';
import './Sobre.css';

const SobrePage = () => {
  return (
    <div>
      <h2>Sobre Mim</h2>
      <p>Sou Gabriela Barbara, farmacêutica formada em 2022, com experiência em farmácia hospitalar e logística farmacêutica. Tenho paixão por compartilhar conhecimento e inspirar pessoas, o que me levou a criar o Instagram @umaestudantedefarmacia , onde ajudo estudantes e profissionais da área a se desenvolverem e serem sua melhor versão.

Espero te ajudar muito com os meus conteúdos!

Pós graduada em: Farmácia Hospitalar e acompanhamento oncologico;

Farmacia Clinica e prescrição farmacêutica;

Membro do GTT de Publicidade e propaganda pelo CRF MG.</p>
    </div>
  );
};

export default SobrePage;
